import React, { useState, useEffect } from 'react'
import Card from '../components/Card';
import axios from 'axios';
import TextField from '@mui/material/TextField';
import Search from '@mui/icons-material/Search';
import Box from '@mui/material/Box';
import Input from '@mui/material/Input';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormControl from '@mui/material/FormControl';


function Listings() {
  const [titleSearch, settitleSearch] = useState("")
  const [citySearch, setcitySearch] = useState("")
  const [listings, setlistings] = useState([]);
  useEffect(() => {
    const fn = async () => {
      let resp = await axios.get(`http://localhost:5005/listings`);
      if (resp.status === 200) {
        setlistings(resp.data.listings)
      }
    }
    fn();
  }, [])


  return (
    <div style={{ marginTop: "100px" }}>
      <div style={{display: "flex", flexDirection: "row", justifyContent: "center" }}>

        <TextField
        style={{backgroundColor:'white', padding:"5px", borderRadius: "10px"}}
          id="input-with-icon-textfield"
          label="TextField"
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <Search />
              </InputAdornment>
            ),
          }}
          variant="standard"
        />
      </div>
      {listings.map((e, i) => {
        return (<Card key={i} thumbnail={e.thumbnail} title={e.title} price={e.price} reviews={e.reviews} />)
      })}
    </div>
  )
}

export default Listings
